import React from 'react';
import { Container, Label } from './styles';

export default function Card() {
  return (
    <Container>
      <header>
        <label color='#7159c1' />
      </header>
      <p>Fazer migração completa do Servidor.</p>
      <img src="http://rocketseat-cdn.s3-sa-east-1.amazonaws.com/profile.png" alt=""/>
    </Container>
  );
}
